import React from 'react';

class Menu extends React.Component {

    render() {
        return (<div className="options">
                    <p onClick={() => this.props.menuSelection('home')}>Home</p>
                    <p onClick={() => this.props.menuSelection('wedding')}>Wedding</p>
                    <p onClick={() => this.props.menuSelection('travel')}>Travel</p>
                    <p onClick={() => this.props.menuSelection('rsvp')}>RSVP</p>
                </div>);
    }
}

export default Menu;
